import React, { useState, useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import "../assets/styles/Home.css";

const Home = () => {
  const [currentImage, setCurrentImage] = useState(0);
  const carouselImages = ["/images/slide1.jpg", "/images/slide2.jpg", "/images/slide3.jpg"];

  useEffect(() => {
    AOS.init({ duration: 1000 });
  }, []);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImage((prev) => (prev + 1) % carouselImages.length);
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  const handleCarouselClick = (index) => {
    setCurrentImage(index);
  };

  const services = [
    { name: "Dry Massage", price: "1500", desc: "Traditional dry therapy." },
    { name: "Aroma Oil Massage", price: "2000", desc: "Calm with essential oils." },
    { name: "Cream Massage", price: "2500", desc: "Soothing cream touch." },
    { name: "Mintjel Massage", price: "2500", desc: "Cool mint therapy." },
    { name: "Chocolate Massage", price: "3000", desc: "Sweet stress relief." },
    { name: "Deep Tissue Massage", price: "3000", desc: "Relieve deep tension." },
    { name: "Thai Massage", price: "4000", desc: "Classic Thai technique." },
    { name: "Hand Massage", price: "4000", desc: "Focused hand healing." }
  ];

  return (
    <div className="home">

      {/* Full Width Carousel */}
      {/* <div className="carousel" data-aos="fade-down">
        <img src={carouselImages[currentImage]} alt={`slide-${currentImage}`} className="carousel-image" />
        <div className="carousel-nav">
          {carouselImages.map((_, index) => (
            <button
              key={index}
              className={`carousel-btn ${currentImage === index ? "active" : ""}`}
              onClick={() => handleCarouselClick(index)}
            ></button>
          ))}
        </div>
      </div> */}
      <div className="carousel">
        <img
          src={carouselImages[currentImage]}
          alt={`carousel-img-${currentImage}`}
          className="carousel-image"
        />
        <div className="carousel-nav">
          {carouselImages.map((img, index) => (
            <button
              key={index}
              className={`carousel-btn ${currentImage === index ? "active" : ""}`}
              onClick={() => handleCarouselClick(index)}
            ></button>
          ))}
        </div>
      </div>

      {/* Services */}
      <section className="services" data-aos="fade-up">
        <h2 className="section-title">âœ¨ Our Services</h2>
        <div className="service-grid">
          {services.map((service, index) => (
            <div key={index} className="service-card" data-aos="zoom-in-up">
              <h3>{service.name}</h3>
              <p>{service.desc}</p>
              <span>â‚¹ {service.price}</span>
            </div>
          ))}
        </div>
      </section>

      {/* Offers */}
      <section className="offers" data-aos="zoom-in">
        <h2 className="section-title">ðŸ’« Special Offers</h2>
        <p className="offer-description">Enjoy our limited-time spa packages starting at â‚¹1199!</p>
      </section>

      {/* About Us */}
      <section className="about" data-aos="fade-right">
        <h2 className="section-title">About Us</h2>
        <p>
          Midnight Spa is your ultimate destination for relaxation and rejuvenation. Offering various soothing therapies including Dry Massage, Aroma Oil Massage, and more, our spa ensures you leave feeling refreshed and revitalized.
        </p>
      </section>

      {/* Three Image Carousel */}
      <section className="three-image-carousel" data-aos="fade-left">
        <div className="carousel-row">
          <img src="/images/c.jpg" alt="img1" className="carousel-image" />
          <img src="/images/d.jpg" alt="img2" className="carousel-image" />
          <img src="/images/c.jpg" alt="img3" className="carousel-image" />
        </div>
      </section>

      {/* Contact Us */}
      <section className="contact" data-aos="fade-up">
        <h2 className="section-title">ðŸ“ž Contact Us</h2>
        <p>Have questions? Weâ€™d love to hear from you!</p>
        <form>
          <input type="text" placeholder="Your Name" className="contact-input" />
          <input type="email" placeholder="Your Email" className="contact-input" />
          <textarea placeholder="Your Message" className="contact-input"></textarea>
          <button type="submit" className="contact-btn">Send Message</button>
        </form>
      </section>

      {/* Footer */}
      <footer className="footer" data-aos="fade-up">
        <p>Â© 2025 Midnight Spa - All Rights Reserved</p>
      </footer>
    </div>
  );
};

export default Home;
